"719088":{"id":"719088","name":"Yes, No, or Maybe?","slug":"yes-no-or-maybe","original_title":"イエスかノーか半分か","overview":"Kei Kunieda é um locutor que mantém estritamente uma personalidade amável e gentil durante o trabalho. Embora ele sorria por fora, ele secretamente amaldiçoa os outros para o conteúdo de seu coração. Sua vida cotidiana é tranquila, mesmo que ele mantenha metade de si mesmo escondido o tempo todo, mas isso muda quando ele conhece Ushio Tsuzuki, um animador stop-motion independente. Logo, Kei se vê pego em uma mentira de suas duas personas conhecerem Ushio em condições diferentes, com o outro homem sem saber que são a mesma pessoa. À medida que os sentimentos começam a florescer entre eles, Kei não pode ter certeza se Ushio amará os dois lados dele - ou apenas a metade.","first_air_date":"2020-12-11","runtime":53,"episode_run_time":[53],"vote_average":7.2,"created_by":["Lesprit"],"production_companies":[{"name":"Lesprit"}],"cast":["Atsushi Abe","川原慶久"],"backdrop_path":"https://image.tmdb.org/t/p/original/yjmqROw9fa9GahuUxvBFnoVYYMG.jpg","poster_path":"https://image.tmdb.org/t/p/original/sH8xCXLEbihNNVDbewddzkYnNPF.jpg","certification":"16","genres":["Animação","Drama","Romance"],"trailer":"N/A"},
