"54491":{"id":"54491","name":"O Cisne Apaixonado","slug":"o-cisne-apaixonado","original_title":"The Trumpet of the Swan","overview":"Quando nascem trigêmeos numa família de cisnes, todos ficam cheios de orgulho. Tudo parece perfeito até que eles descobrem que seu único filho macho, Louie, não tem voz e sem ela, ele não pode ocupar um lugar no mundo musical de sua família. Com uma inesperada ajuda de um amigo humano e um presente muito especial de seu pai, Louie descobre que sua voz diferente traz um novo sopro à música tocada pelos cisnes.","first_air_date":"2001-05-11","runtime":75,"episode_run_time":[75],"vote_average":5.5,"created_by":["TriStar Pictures","NEST Family Entertainment","Crest Animation"],"production_companies":[{"name":"TriStar Pictures"},{"name":"NEST Family Entertainment"},{"name":"Crest Animation"}],"cast":["Dee Bradley Baker","Jason Alexander","Mary Steenburgen","Reese Witherspoon","Kath Soucie"],"backdrop_path":"https://image.tmdb.org/t/p/original/dXVBOVU4fUs5ByQ6ftoWuWZNGp.jpg","poster_path":"https://image.tmdb.org/t/p/original/qM3rk7O6QRIBCxpVnrLjpbmzb0G.jpg","certification":"N/A","genres":["Família","Animação"],"trailer":"N/A"},
"363871":{"id":"363871","name":"Peter Pan","slug":"peter-pan","original_title":"DQE's Peter Pan: The New Adventures","overview":"Tudo continua exatamente igual na Terra do Nunca. Mas, no mundo real, o tempo passou. Uma nova geração de crianças da família Darling se junta a Peter Pan e Sininho nas aventuras contra o Capitão Gancho e os males que habitam sua amada Terra do Nunca. Wendy encontra o diário de sua tataravó de mesmo nome junto com a flauta de Peter Pan. Ao descobrir que ele realmente existe, ela e seus irmãos João e Miguel não hesitarão em embarcar nessa jornada cheia de ação e magia. Como boas crianças do século XXI, Wendy, João e Miguel levarão seu conhecimento, novas ideias, as últimas novidades e tecnologias para os meninos e meninas perdidos. As Novas Aventuras de Peter Pan levarão ação, fantasia e humor para a telinha, além de valores como amizade, lealdade e coragem.","first_air_date":"2015-10-14","runtime":90,"episode_run_time":[90],"vote_average":7.8,"created_by":["Entertainment One"],"production_companies":[{"name":"Entertainment One"}],"cast":["Matt Hill","Michelle Creber"],"backdrop_path":"https://image.tmdb.org/t/p/originalnull","poster_path":"https://image.tmdb.org/t/p/original/7IJwKzVKGhfjZLnWhPwIZ5EYGFS.jpg","certification":"N/A","genres":["Animação","Família","Aventura"],"trailer":"N/A"},
"618748":{"id":"618748","name":"As Fantasias de Nicolás","slug":"as-fantasias-de-nicolas","original_title":"Un disfraz para Nicolás","overview":"Nicolás é um menino de 10 anos com Síndrome de Down e o maior dos corações e da imaginação. Quando a mãe de Nicolás morre, ele se muda para a casa de seus avós com seu primo David, um adolescente que não tem paciência para aprender a se dar bem com ele. Eles terão que resolver suas diferenças quando Nicolás descobrir um portal para um reino cujos sonhos precisam ser salvos.","first_air_date":"2021-09-16","runtime":80,"episode_run_time":[80],"vote_average":8.0,"created_by":["Fotosíntesis Media"],"production_companies":[{"name":"Fotosíntesis Media"}],"cast":["Paty Cantú","Fran Fernández","Cristina Hernandez","Ricardo Tejedo"],"backdrop_path":"https://image.tmdb.org/t/p/original/rABqUZSOS2uaCkGm0NV4EXyxlhc.jpg","poster_path":"https://image.tmdb.org/t/p/original/razgQWxwMFXyhI6musNJBTgCUbb.jpg","certification":"N/A","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
"67159":{"id":"67159","name":"Situação Delicada","slug":"situacao-delicada","original_title":"Out on a Limb","overview":"O médico de árvores, Pato Donald, bate de frente com os esquilos encrenqueiros, Tico e Teco, ao encontrá-los guardando nozes na árvore que está tratando. Donald acaba com a paz da dupla com seu podador de galhos (que os esquilos confundem com um pássaro) e um balde de piche, mas Tico e Teco saem por cima e Donald se depara com uma situação chocante.","first_air_date":"1950-12-15","runtime":7,"episode_run_time":[7],"vote_average":6.9,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Clarence Nash","James MacDonald","Dessie Flynn"],"backdrop_path":"https://image.tmdb.org/t/p/original/jmflJ8G6VbN2Xa7nCghCEIpGOOj.jpg","poster_path":"https://image.tmdb.org/t/p/original/e1FUcWDabOsVBkvbxlTLHuxXtoE.jpg","certification":"L","genres":["Animação","Comédia"],"trailer":"N/A"},
"285733":{"id":"285733","name":"Barbie e o Portal Secreto","slug":"barbie-e-o-portal-secreto","original_title":"Barbie and the Secret Door","overview":"Em seu novo filme, Barbie estrela como a Alexa, uma linda princesa que descobre um Portal Secreto que leva a uma terra encantada cheia de surpresas e seres mágicos! Ao cruzar o Portal, Alexa conhece a sereia Romy e a fada Nori e elas lhe contam que uma princesa mimada chamada Malúcia está capturando toda a magia do reino só para ela. Para sua surpresa, nesse mundo Alexa ganha poderes mágicos, e suas novas amigas têm certeza de que somente ela pode recuperar a magia do reino. Descubra o que acontece quando a princesa Alexa deixa seus medos de lado e defende suas amigas de Malúcia, e percebe que o poder da amizade é muito mais precioso que qualquer magia.","first_air_date":"2014-08-30","runtime":81,"episode_run_time":[81],"vote_average":7.2,"created_by":["Mattel Playground Productions","Mattel","Rainmaker Entertainment"],"production_companies":[{"name":"Mattel Playground Productions"},{"name":"Mattel"},{"name":"Rainmaker Entertainment"}],"cast":["Kelly Sheridan","Brittany McDonald","Ashleigh Ball","Chanelle Peloso","Tabitha St. Germain"],"backdrop_path":"https://image.tmdb.org/t/p/original/d8YV61996Zq00UqSVBV9K8KJgN4.jpg","poster_path":"https://image.tmdb.org/t/p/original/uhaUcohBo40n9Uf8CtKW6Q1aUA4.jpg","certification":"L","genres":["Animação","Família"],"trailer":"N/A"},
