"454286":{"id":"454286","name":"Deus Não Está Morto: Uma Luz na Escuridão","slug":"deus-nao-esta-morto-uma-luz-na-escuridao","original_title":"God's Not Dead: A Light in Darkness","overview":"Quando um incêndio terrível atinge a Igreja de Saint James, devastando a congregação e o Pastor Dave, a universidade vizinha, a Hadleigh University, usa a tragédia para tentar despejar a congregação de seu campus. Uma batalha legal se instaura entre a igreja e a comunidade, e o Pastor Dave precisa enfrentar seu amigo de longa data Thomas Ellsworth, o presidente da universidade. Dave recorre a seu irmão, um advogado ateu, para tentar reerguer a igreja.","first_air_date":"2018-03-30","runtime":105,"episode_run_time":[105],"vote_average":6.6,"created_by":["Pure Flix Entertainment"],"production_companies":[{"name":"Pure Flix Entertainment"}],"cast":["David A.R. White","John Corbett","Jennifer Taylor","Benjamin Ochieng","Tatum O'Neal"],"backdrop_path":"https://image.tmdb.org/t/p/original/4vBafKZEdw6aFvN7wQ2vZV9bjv4.jpg","poster_path":"https://image.tmdb.org/t/p/original/dSV0a3TxdJCiniddhETG8EGVTeb.jpg","certification":"12","genres":["Drama"],"trailer":"QInuXHJRj8s"},
